#!/bin/bash
# date 2017-11-23 12:58:36
# author calllivecn <c-all@qq.com>

set -e

############################
#
# 测试笔记本是否有AC电源
# 没有就关机
#
############################

program=${0##*/}

AC=/sys/class/power_supply/AC/online
AC=/sys/class/power_supply/ADP0/online
CHECK_POWER=/tmp/power.ac
TOUCH_FILE=/tmp/cancel.ac

USER_ID=$(id -u)
PID="/run/user/${USER_ID}/${program%.sh}.pid"

POWEROFF_TIMEOUT=600 # 15minute

if [ -w "$PID" ];then
	echo "$program is runing"
	exit 0
else
	echo $$ > "$PID"
fi

notify(){
	notify-send "$1"
}


###########################
#
# 事件循环EVENT is in :
# Check,CancelAndRecovery,
# Cancel,RecoveryPower,PowerOff
#
##########################

# init EVENT
EVENT='Check'

check_environment(){
	if ! test -f $AC;then
		notify "$AC 不存在,exit $program"
		exit 1
	fi
}

check_power(){
	while :
	do
		stat=$(cat "$AC")
		if [ $stat -eq 1 ];then
			sleep 5
		else
			EVENT='CancelAndRecovery'
			break
		fi
	done
}

cancel_and_recovery(){
	for i in $(seq $POWEROFF_TIMEOUT) 
	do
		stat=$(cat "$AC")
		if [ -f "$TOUCH_FILE" ];then
			EVENT='Cancel'
			rm "$TOUCH_FILE"
			break
		elif [ $stat -eq 1 ];then
			EVENT='RecoveryPower'
			break
		fi

		if [ $i -ge $POWEROFF_TIMEOUT ];then
			EVENT='PowerOff'
			break
		fi
		sleep 1
	done
}

cancel(){
	while :
	do
		if [ -f "$CHECK_POWER" ];then
			EVENT='Check'
			rm "$CHECK_POWER"
			break
		fi
		sleep 5
	done
}

check_environment

########################
#
# test data
#
#######################

#check_environment

while :
do
	#echo 当前状态： "$EVENT"
	case "$EVENT" in
		'Check')
			check_power
			;;
		'CancelAndRecovery')
			notify "AC下线，5分钟后关机 取消命令 touch $TOUCH_FILE"
			cancel_and_recovery
			;;
		'RecoveryPower')
			notify "AC上线，取消关机。"
			EVENT='Check'
			;;
		'Cancel')
			notify "AC进入取消，状态。touch $CHECK_POWER 进入AC检测状态。"
			cancel
			;;
		'PowerOff')
			systemctl poweroff -i
			;;
	esac
done

exit 0
